  \"2013-11-26T21:36:18.048473\",\n\t\"name\": \"alaska-nad-83-official-protraction-diagram-opd-outlines\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This data set contains Official Protraction
  Diagram (OPD) outlines in ESRI shapefile format. At lower latitudes (0-48 degrees)
  OPDs are 1 degree in latitude by 2 degrees in longitude. At higher latitudes (48-75
  degrees) OPDs are 3 degrees wide. OPDs are further subdivided into blocks that are
  4800 x 4800 meters on a UTM grid (but this file does not include those blocks -
  only the OPD outline). Where the OPD hits the UTM zone boundary, that zone boundary
  will be a geodesic line - which will appear slightly curved on the UTM grid. OPDs
  are numbered using the United Nations International Map of the World Numbering System,
  and are generally named for land or hydrographic features contained within the limits
  of the diagram. Further information on the historic development of OPD's can be
  found in OCS Report MMS 99-0006: Boundary Development on the Outer Continental Shelf:
  http://www.boem.gov/BOEM-Newsroom/Library/Publications/1999/99-0006-pdf.aspx Because
  GIS projection and topology functions can change or generalize coordinates, these
  GIS files are considered to be approximate and are NOT an OFFICIAL record for the
  exact OPD coordinates or areas. The Official Protraction Diagrams (OPDs) and Supplemental
  Official OCS Block Diagrams (SOBDs), available on the web in pdf format, serve as
  the legal definition for BOEM offshore boundary coordinates and area descriptions.\",\n\t\"license_title\":
